import React, {useEffect, useState} from 'react';

import Playlist from './Playlist';

function Playlists() {
    const [playlists, setPlaylists] = useState([])

  return (
    <div>
      {playlists.map((playlist) => (
        <Playlist key={playlist.id} playlist={playlist} />
      ))}
    </div>
  );
}

export default Playlists;
